import React from "react";

const inputField = {
    padding: '20px',
  }

const input = {
    fontSize: '26px',
    width: '80%',
    border: 'none',
    background: 'rgba(0, 0, 0, .3)',
    borderRadius: '8px'
}

const contactBtn = {
    color: 'white',
    fontSize: '26px',
    marginLeft: '20px',
    border: 'none',
    background: 'rgba(0, 0, 0, .3)',
    borderRadius: '8px',
    padding: '10px',
    marginTop: '5%'
}

function Contact() {

  return (
    <div>
        <div style={pageMargins}>
        <h1>Contact</h1>
            <div style={inputField}>
              <input style={input} type="text" placeholder="name" />
            </div>
            <div style={inputField}>
              <input style={input} type="number" placeholder="phone" />
            </div>
            <div style={inputField}>
              <input style={input} type="text" placeholder="email" />
            </div>
            <button style={contactBtn}>Submit</button>
        </div>
    </div>
  );
}

export default Contact;
